import React from 'react';
import './../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './../../node_modules/bootstrap/dist/js/bootstrap.min.js';

import devLogo from "../Resources/Icons/icons8-dev-48.png";

const MainNav = () =>{



  return (
        <div className = "Container">
        <nav className="navbar navbar-expand-sm bg-body-tertiary"data-bs-theme="dark" >
  <div className="container-fluid">

      <a className="navbar-brand" href="#">
        <img src= {devLogo} width = "30" height = "30" />
        Siya</a>



    <button className="navbar-toggler bg-primary" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav">
        <a className="nav-link active" aria-current="page" href="#">Home</a>
        <a className="nav-link" href="#">About me</a>
        <a className="nav-link" href="#">Projects</a>
        <a className="nav-link">Contact me</a>
      </div>
    </div>
  </div>
</nav>
        </div>);
}


export default MainNav;
